    var polygons = [];
    function set_data(idx)
    {
        if (idx >= values.length)
        {
            return;
        }
        
        while(polygons[0])
        {
          polygons.pop().setMap(null);
        }
        
        for (var x = 0; x < latitudes.length - 1; x++)
        {
            for (var y = 0; y < longitudes.length - 1; y++)
            {
                if (values[idx][x][y] === '')
                {
                    continue;
                }
                
                var coords = [
                    new google.maps.LatLng(latitudes[x], longitudes[y + 1]),
                    new google.maps.LatLng(latitudes[x + 1], longitudes[y + 1]),
                    new google.maps.LatLng(latitudes[x + 1], longitudes[y]),
                    new google.maps.LatLng(latitudes[x], longitudes[y]),
                ];
                
                var polygon = new google.maps.Polygon({
                    clickable: false,
                    geodesic: true,
                    fillColor: values[idx][x][y],
                    fillOpacity: 0.600000,
                    paths: coords,
                    strokeColor: values[idx][x][y],
                    strokeOpacity: 0.600000,
                    strokeWeight: 0
                });
                
                polygon.setMap(map);
                polygons.push(polygon);
            }
        }
    }
    
    function get_map_count()
    {
        return values.length;
    }

